import React from 'react';
import triumph from '../../assets/logo.001.beige.PNG';
import "./footer.css";

export default function Footer() {
  return (
    <>
        <div className='footer'>
            <div className='logoContainer2'>
                <img className='triumphLogo2' src={triumph} alt="" />

            </div>
        </div>
    </>

  )
}
